import Mock from 'mockjs';
import { login, logout, getUserInfo } from "./login";
import { getTableData, getDragList, uploadImage, getOrgData, getTreeSelectData } from "./data";
import { getMessageInit, getMessageContentByMsgId, hasMessageRead, removeMessageReaded, restoreMessageTrash, messageCount } from "./user";

// 配置Ajax请求延时，可用来测试网络延迟大时项目中一些效果
Mock.setup({
  timeout: 1000
});

// 登录相关和获取用户信息
Mock.mock(/\/login/, login);
Mock.mock(/\/userInfo/, getUserInfo);
Mock.mock(/\/logout/, logout);
Mock.mock(/\/get_table_data/, getTableData);
Mock.mock(/\/get_drag_list/, getDragList);
Mock.mock(/\/save_error_logger/, 'success');
Mock.mock(/\/image\/upload/, uploadImage);
Mock.mock(/\/message\/init/, getMessageInit);
Mock.mock(/\/message\/content/, getMessageContentByMsgId);
Mock.mock(/\/message\/has_read/, hasMessageRead);
Mock.mock(/\/message\/remove_readed/, removeMessageReaded);
Mock.mock(/\/message\/restore/, restoreMessageTrash);
Mock.mock(/\/message\/count/, messageCount);
Mock.mock(/\/get_org_data/, getOrgData);
Mock.mock(/\/get_tree_select_data/, getTreeSelectData);
export default Mock;
